#v3: instead of storing each pair count in a list; we can create dictionary with key as absolute sum and value as number of occurances of that .
#Memory excedded got resolved out BUT now we are getting TIME limit exceeded
import time
class Solution:
        
    def get_abs_val_all(self):
        abs_val_all ={}
        tot_nums = len(self.nums)
        i=1
        for first in self.nums:#first pair element
            for s in range(i,tot_nums):#second element
                # all_pair.append([first,self.nums[s]])
                abs_val = self.get_abs_val_s(first,self.nums[s])
                if abs_val not in abs_val_all:
                    abs_val_all[abs_val] =1
                else:
                    abs_val_all[abs_val] +=1                
            i+=1
        return abs_val_all
    
    def get_abs_val_s(self,num1,num2):
        diff = num1-num2
        if diff<0:
            diff = diff*-1
        return diff
    
    def target_occurnace(self,abs_val_lis):
        count=0
        for k,v in abs_val_lis:
            count+=v
            if count>= self.target:
                return k
        return -1 #if number of parirs are less than given k/ target
     
    def smallestDistancePair(self, nums: list[int], k: int) -> int:
        self.nums =nums
        self.target= k
        abs_val = self.get_abs_val_all()
        # print(abs_val)
        abs_val=sorted(abs_val.items(),key=lambda kv:kv[0])
        # print(abs_val)
        return self.target_occurnace(abs_val)
        if k<= len(abs_val):
            # print("target pair",sorted_all_pairs[k-1])
            return abs_val[k-1]#self.get_abs_val(sorted_all_pairs[k-1])
        return 0

